        [Trait("Category", "PostRubricaProfissionalSaude")]
        [Fact(DisplayName = "Validação falha quando base64RubricaGif não é uma imagem GIF válida")]
        public void Validacao_Falha_Quando_Base64RubricaGif_Nao_Eh_Gif_Valido()
        {
            // Arrange
            var postRubricaProfissionalSaude = new PostRubricaProfissionalSaude
            {
                idProfissionalSaude = 123,
                base64RubricaGif = "",
            };

            // Act
            var results = new List<ValidationResult>();
            var context = new ValidationContext(postRubricaProfissionalSaude, null, null);
            var isModelStateValid = Validator.TryValidateObject(postRubricaProfissionalSaude, context, results, true);

            // Assert
            Assert.False(isModelStateValid);
            Assert.Contains(results, v => v.ErrorMessage == "O campo base64RubricaGif deve ser uma imagem GIF válida em formato base64.");
        }

